import React from "react";

const ReadOnlyRows = ({ contact, index, handleEditClick }) => {
    return (

        <tr key={contact.id}>
            <td>{index + 1}</td>
            <td>{contact.fullName}</td>
            <td>{contact.address}</td>
            <td>{contact.phoneNumber}</td>
            <td>{contact.email}</td>
            <td>
                <button type="button" onClick={(event) }>Edit</button>
            </td>
        </tr>

    );
};

export default ReadOnlyRows;
